import React from "react";

const Search = () => {
   return (
      <div>
         <h1 className="header" align="center">
         Search for Games!
         </h1>
         <input className="header" align="center" placeholder="Search"/>
         <button align="center">Search</button>
      </div>
   );
};

export default Search;
